    const jogos = [
        {
          nome: 'Jogo 1',
          imagem: '/imagens/grazinha.png'
        },
        {
          nome: 'Jogo 2',
          imagem: '/imagens/dashAndGetOut.png'
        },
        {
          nome: 'Jogo 3',
          imagem: '/imagens/pech.png'
        },
      ]

    return(
        <section className='espaco-botoes'>
            <Botao
                nome={nome}
                imagem={imagem}
            />
            <Botao
                nome={nome}
                imagem={imagem}
            />
            <Botao
                nome={nome}
                imagem={imagem}
            />
        </section>
    )
}

